import React, { Component } from 'react';


class Notifcation extends Component{

render(){
  return(
    <header>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/notification">
                Notification
              </Link>
            </li>
          </ul>
        </nav>
      </div>
    </header>
    
  )
}

}
export default Notifcation;
